import { useLocation } from 'react-router-dom';
import Left from "./Left.js"
import Middle from "./Middle.js"
import Right from "./Right.js"
import { form } from 'framer-motion/client';

function ChatPage() {
  const location = useLocation();
  const formData = location.state || {};
  const [middleKey, setMiddleKey] = React.useState(0);
  console.log("Received in ChatPage:", formData);

  const resetMiddle = () => {
    setMiddleKey((prev) => prev + 1);
  };

  return (
    <div style={{display:"flex", justifyContent:"space-between", backdropFilter: 'blur(8px)'}}>
      <Left onReset={resetMiddle} formData={formData} />
      <Middle key={middleKey} formData={formData} />
      <Right formData={formData} />
    </div>
  );
}

export default ChatPage;
